function koAccountModel(n){var t=this;t.idAccount=ko.observable(n.idAccount);t.Text=ko.observable(n.Text);t.TypeValue=ko.observable(n.TypeValue);t.Type=ko.observable(n.Type);t.ClosingDay=ko.observable(n.ClosingDay);t.DueDay=ko.observable(n.DueDay);t.Active=ko.observable(n.Active)}var koAccountContext=function(){var n=this;n.isLoading=ko.observable(!1);n.isSaving=ko.observable(!1);n.justActive=ko.observable(!0);n.data=ko.observableArray([]);n.dataFiltered=ko.computed(function(){return $.grep(n.data(),function(t){return t.Active()==!0||!n.justActive()})},n);n.loadData=function(){n.isLoading(!0);n.data.removeAll();GetDataJson({url:GetActionUrl("Accounts","GetData"),success:function(t){t.Result&&$.each(t.Data,function(t,i){n.data.push(new koAccountModel(i))})},done:function(){n.isLoading(!1)}})};n.addData=function(){n.selectData(new koAccountModel({idAccount:-1,Text:"",TypeValue:0,Type:0,ClosingDay:"",DueDay:"",Active:!0}))};n.openData=function(){var t=$(this)[0],i=ko.toJS(t),r=new koAccountModel(i);n.selectData(r)};n.selectedData=ko.observable();n.selectData=function(t){n.selectedData(t);$("#editModal").modal({ready:function(){$("select").material_select()},show:!0})};n.saveData=function(){n.isSaving(!0);PostDataJson({url:GetActionUrl("Accounts","SaveData"),data:n.selectedData(),success:function(){n.loadData();$("#editModal").modal("close")},form:$("#editModal"),done:function(){n.isSaving(!1)}})};n.removeData=function(){n.isSaving(!0);PostDataJson({url:GetActionUrl("Accounts","RemoveData"),data:n.selectedData(),success:function(){n.loadData();$("#editModal").modal("close")},form:$("#editModal"),done:function(){n.isSaving(!1)}})};n.IsActiveUser=ko.computed(function(){return authIsActiveUser()},n);n.loadData()};